import React from 'react';
import {Page, Text, View, Document, StyleSheet, Font, Image, Line} from '@react-pdf/renderer';
import Hall from "../../pages/event/hall";
import LogoTicket from "../../assets/LogoTicket.png";
import  helvetica from  "../../assets/Font/Helvetica/helvetica_regular.otf"
import {QRCode} from "antd";
Font.register({
    family: "Robot",
    src:
        "https://cdnjs.cloudflare.com/ajax/libs/ink/3.1.10/fonts/Roboto/roboto-light-webfont.ttf"
});
Font.register({
    family: "RobotBold",
    src:
        "https://cdnjs.cloudflare.com/ajax/libs/ink/3.1.10/fonts/Roboto/roboto-bold-webfont.ttf"
});
// Create styles

const styles = StyleSheet.create({
    body: {
        paddingTop: 35,
        paddingBottom: 65,
        paddingHorizontal: 35,
        fontFamily: "Robot",
    },
    page: {
        flexDirection: "row",
        backgroundColor: "#E4E4E4",
        fontFamily: "Robot",
    },
    section: {
        margin: 10,
        padding: 10,
        flex: 1,
        flexDirection: "column",
        justifyContent: "space-between",
    },
    text: {
        fontFamily: "Robot",
    },
    line: {
        marginTop: 20,
        marginBottom: 20,
        borderBottom: "1pt solid #391085",
    },
    logo: {
        width: 7.35,
        height: 2.36,
        marginTop: 40,
        marginBottom: 20,
        alignSelf: "center",
    },
    textBold: {
        fontFamily: "RobotBold",
    }
});

const Ticket = () => {
    const src = 'https://createqr.ru/api/v1/qr-pay?Name=Иванов И. И';

    return (
        <Document>
            <Page orientation="landscape" size="A4" style={styles.page}>
                <View style={styles.section}>
                    <Text style={{ fontSize: 28 }}>Заголовок</Text>
                    
                        <Text style={{ fontSize: 14, flex: 1 }}>Место: Rockstar Bar. ул. Пушкина, 29А</Text>
                        <Text style={{ fontSize: 14, flex: 1 }}>Дата и время: 25 сентября 20:01</Text>
                    <Text style={{ fontSize: 14 }}>Стоимость: 1 012 руб.</Text>
                        <Text style={{ fontSize: 14, flex: 1 }}>Категория: Танцпол</Text>
                        <Text style={{ fontSize: 14, flex: 1 }}>(14 шрифт, все что до двоеточия серым цветом, все что после динамически обновляется)</Text>

                </View>
                <View style={styles.section}>
                    <Image
                        cache={false}
                        src={src}
                        style={{ width: 3.5, height: 3.5 }}
                    />
                    <View style={styles.section}>
                        <View style={{ flexDirection: 'row', marginTop: 10 }}>
                            <Image
                                cache={false}
                                src={src}
                                style={{ width: 3.5, height: 3.5, marginRight: 10 }}
                            />
                            <Text style={{ fontSize: 12, flex: 1 }}>Text</Text>
                        </View>
                        <Text style={styles.textBold}>Как работает билет</Text>
                        <Text style={{ fontSize: 12, flex: 1 }} >По билету можно пройти только один раз, его нельзя копировать и перепродавать. Не выкладывайте билет в соцсети: другой человек может использовать штрихкод и пройти вместо вас
                        </Text>
                        <Text style={styles.textBold}>Как вернуть</Text>
                        <Text style={{ fontSize: 12, flex: 1 }}>Если событие отменят, заменят или перенесут или у вас просто не получается на него попасть пишите на почту MeropsRoot@hotmail.com</Text>
                        <Text style={styles.textBold}>Участники мероприятия обязаны</Text>
                        <Text style={{ fontSize: 12}}>- соблюдать правила поведения в общественных местах;</Text>
                        <Text style={{ fontSize: 12}}>- занимать места согласно купленному билету;</Text>
                        <Text style={{ fontSize: 12 }}>- сохранять билет до конца мероприятия и предъявлять по требованию администрации и сотрудников службы охраны.</Text>
                        <Image
                            cache={false}
                            src="../../path/to/logo.png"
                            style={styles.logo}
                        />
                    </View>
                </View>
            </Page>
        </Document>
    )
};

export default Ticket;
